import React from 'react';

export default function Rating(props) {
  const { rating, numReviews } = props;
  let tempStar = [];
  const ShowRating = () => {
    let nStar = parseInt(rating);
    console.log(nStar);
    for (let i = 0; i < nStar; i++) {
      tempStar.push(1);
    }
  };
  return <div>{ShowRating()}</div>;
}
